import React from 'react';
import './App.css';

class teambuilding extends React.Component{
	constructor(props){
		super(props);
		this.state = {
			pokemon : []
		}
	}
	render(){
		return(
			<div>
				<header class="header">Elements header</header>
			</div>
		)
	}	
}

export default teambuilding;
